import React from 'react';
import TodayTask from './TodayTask/TodayTask';
//import Aux from '../containers/hoc/aux';
const todayTasks = props => {
  //get props from app.js, run through each element in state to feed into <Task>
  //todo,deadline,location,key,click, changed sent to <Task>

  const wtf = () => {
    props.monday.map((monday, index) => {
      return (
        <React.Fragment>
          <th scope="row">1</th>
          <td>{monday.id}</td>
          <td>{monday.task}</td>
        </React.Fragment>
      );
    });
  };

  return (
    <React.Fragment>
      <table className="table">
        <thead>
          <tr>
            <th>#</th>
            <th>Time </th>
            <th>Task</th>
          </tr>
        </thead>

        <tbody>
          <tr className="table-success">{wtf}</tr>
        </tbody>
      </table>
    </React.Fragment>
  );
};
export default todayTasks;

